import React from 'react';
import { NavLink } from 'react-router-dom';

const SignedOutLinks = () => {
    var { path, pathName } = require('../../config/config');

    return (
        <ul className="right">
            <li><NavLink to={this.path.sign_in} className="waves-effect waves-light">{this.pathName.sign_in}</NavLink></li>
            <li><NavLink to={this.path.sign_out} className="waves-effect waves-light">{this.pathName.sign_in}</NavLink></li>
        </ul>
    )
}

export default SignedOutLinks;
